Rainbow coloured @icecream waffle cones and fab spring flavours @fourwintersuk Soho 🌈💙💚💛🙌 #InTheHands: Matcha with honey and shortbread toppings (my fave) 🌿 Rose Lokum (Turkish delight) with tea biscuits (🙋) and Bee's Knees with homemade spicy honey brittle and honey 🐝 They've also got Marshmallow Passion I'll be coming back for 👅 A great Soho spot for an ice cream fix, made to order with liquid nitrogen. Btw these colourful cones (which they make themselves, natural colourings ofc) are actually only around until 23rd April - they should totes keep them 🍦 Very much ready for summer now ☀️ Thanks for the fab hand modelling skills Melanie ✋😄
